import './App.scss';
import React from 'react';
import TitleName from './components/TitleName/TitleName';
// Counter
import {Listtitle,Listtitle2,Listtitle3} from './components/Counter/Listtitle/Listtitle';
import CounterList from './components/Counter/Counter_List/CounterList';
// TodoList
import styled, {createGlobalStyle} from 'styled-components';
import TodoTitle from "./components/TodoListA/TodoTitle";
import TodoInsert from "./components/TodoListA//TodoInsert";
import TodoItemList from "./components/TodoListA//TodoItemList";
const GlobalStyle = createGlobalStyle`
  body {
    background-color: #425364
  }
`;


function App() {
  return (
    <div className="App">
      <TitleName name = "No.1" />
      <Listtitle name = "[이게 Props 니?]" color = "#ff0"/>
      <CounterList />
      <Listtitle2 />
      <Container>
        <TodoTitle />
        <TodoInsert />
        <TodoItemList />
      </Container>
      <Listtitle3 />
    </div>

  );
}

export default App;
